#ifndef pi
#define pi 3.14159265
#endif

inline double det(arr(double) mtx, int D)
{
   double determinant;
   if (D==1)
      determinant = mtx[0];
   else if (D==2)
      determinant = mtx[0]*mtx[3] - mtx[1]*mtx[2];
   else if (D==3)
   {
      // 0 3 6
      // 1 4 7
      // 2 5 8

      determinant = mtx[0]*(mtx[4]*mtx[8]-mtx[5]*mtx[7])
                  - mtx[3]*(mtx[1]*mtx[8]-mtx[2]*mtx[7])
                  + mtx[6]*(mtx[1]*mtx[5]-mtx[2]*mtx[4]);
   }
   else
   {
      printf("D>3 Not supported for determinants\n");
   }
   return determinant;
}

// computes x'Ax, where x is Dx1, and A is DxD symmetric matrix
inline double xt_A_x(arr(double) x, arr(double)A, int D)
{
   double val, x0, x1, x2, A00, A01, A02, A11, A12, A22;
   switch (D)
   {
      case 1:
         printf("xt_A_x not supported!");
         break;
      case 2:
         x0 = x[0];
         x1 = x[1];
         A00 = A[0];
         A01 = A[1];
         A11 = A[3];
         val = x0*(x0*A00 + x1*A01) + x1*(x0*A01 + x1*A11);
         break;
      case 3:
         x0 = x[0];
         x1 = x[1];
         x2 = x[2];
         A00 = A[0];
         A01 = A[1];
         A02 = A[2];
         A11 = A[4];
         A12 = A[5];
         A22 = A[8];
         val = x0*(x0*A00 + x1*A01 + x2*A02) + x1*(x0*A01 + x1*A11 + x2*A12) + x2*(x0*A02 + x1*A12 + x2*A22);
         break;
      default:
         printf("xt_A_x not supported!");
         break;
   }
   return val;
}
// computes x'Ax, where x is Dx1, and A is DxD symmetric matrix
inline double xt_Ainv_x(arr(double) x, arr(double)A, int D)
{
   double determinant = det(A, D);
   double val, x0, x1, x2, A00, A01, A02, A11, A12, A22, a00, a01, a02, a11, a12, a22;
   switch (D)
   {
      case 1:
         printf("xt_A_x not supported!");
         break;
      case 2:
         x0 = x[0];
         x1 = x[1];
         A00 = A[3]/determinant;
         A01 = -A[1]/determinant;
         A11 = A[0]/determinant;
         val = x0*(x0*A00 + x1*A01) + x1*(x0*A01 + x1*A11);
         break;
      case 3:
         x0 = x[0];
         x1 = x[1];
         x2 = x[2];
         a00 = A[0];
         a01 = A[1];
         a02 = A[2];
         a11 = A[4];
         a12 = A[5];
         a22 = A[8];

         A00 = (a22*a11 - a12*a12)/determinant;
         A01 = (a02*a01 - a22*a01)/determinant;
         A02 = (a12*a01 - a02*a11)/determinant;
         A11 = (a00*a22 - a02*a02)/determinant;
         A12 = (a02*a01 - a12*a00)/determinant;
         A22 = (a11*a00 - a01*a01)/determinant;

         val = x0*(x0*A00 + x1*A01 + x2*A02) + x1*(x0*A01 + x1*A11 + x2*A12) + x2*(x0*A02 + x1*A12 + x2*A22);
         break;
      default:
         printf("xt_A_x not supported!");
         break;
   }
   return val;
}

inline void InvMat2x2(double *mat1, double *result){

    double tmp_sum = (mat1[0]*mat1[3]-mat1[1]*mat1[2]);
    if(tmp_sum<=0 || fabs(mat1[1]-mat1[2])>1E-5)
       printf("Input matrix should be positive definite! ");

    tmp_sum = 1/tmp_sum;
    result[0] = mat1[3] * tmp_sum;
    result[1] = -mat1[1] * tmp_sum;
    result[2] = result[1];
    result[3] = mat1[0] * tmp_sum;
}



