// calculate logmgamma( x/2 );
inline double mylogmgamma(int x, int D)
{
   //double val = 0.25*D*(D-1)*log(pi);
   double val = 0.2861824715 * D * (D-1);
   switch (D)
   {
      case 1:
         val += my_sf_lngamma(x);
         break;
      case 2:
         val += my_sf_lngamma(x)+my_sf_lngamma(x-1);
         break;
      case 3:
         val += my_sf_lngamma(x)+my_sf_lngamma(x-1)+my_sf_lngamma(x-2);
         break;
      default:
         for (int j=1; j<=D; j++)
            val += my_sf_lngamma(x - j);
         break;
   }

   return val;
}

inline double mylogmgamma(double x, int D)
{
   return mylogmgamma((int)(x+0.5), D);
}

inline double mylogmgamma(int x, double D)
{
   return mylogmgamma(x, (int)(D+0.5));
}

inline double mylogmgamma(double x, double D)
{
   return mylogmgamma((int)(x+0.5), (int)(D+0.5));
}

